function renderOneClick() {
	let wrapper = document.querySelector(".one-clicks");
	wrapper.innerHTML = "";
	for(let entry of oneClicks) {
		// Generate element
		let card = document.importNode(document.querySelector("template.one-click-card").content, true).querySelector("*");

		// Set main title
		card.querySelector(".title-text").innerText = entry.name;
		// Set (bold) version
		card.querySelector(".version").innerText = `V${entry.version}`;

		// Set "for" label
		card.querySelector(".for-label").innerText = entry.for;

		// Set main command
		card.querySelector(".one-click").innerHTML = entry.command;

		// Add click thing
		card.querySelector("a").addEventListener("click", () => {
			card.querySelector(".one-click").focus();
			document.execCommand("copy");
		});

		// Add to page
		wrapper.appendChild(card);
	}
}
renderOneClick();